$.tablesorter.addParser({ 
  // set a unique id 
  id: 'date', 
  is: function(s) { 
      // return false so this parser is not auto detected 
      return false; 
  }, 
  format: function(s) { 
  	//Trim off extra text to allow handle checked out 
  	//grid where some dates have extra text, i.e. 
  	//July 22, 2011 OVERDUE
  	var myregexp = /[\s\r\n]*(\w{3}\s+\d{1,2},\s+\d{4})/;
  	var match = myregexp.exec(s);
  	if (match != null) {
  		return Date.parse( match[1]);
  	} else {
  		return Date.parse(s); 
  	}
  }, 
  // set type, either numeric or text 
  type: 'numeric' 
});
