function placeOverDriveHold(overDriveId,formatId){if(loggedIn){var promptInfo=getOverDriveHoldPrompts(overDriveId,formatId,'hold');if(!promptInfo.promptNeeded){doOverDriveHold(overDriveId,formatId,promptInfo.overdriveEmail,promptInfo.promptForOverdriveEmail);}}else{ajaxLogin(function(){placeOverDriveHold(overDriveId,formatId);});}
return false;}
function doOverDriveHold(overDriveId,formatId,overdriveEmail,promptForOverdriveEmail){showProcessingIndicator("Placing a hold on the title for you in OverDrive.  This may take a minute.");var url=path+"/EcontentRecord/AJAX?method=PlaceOverDriveHold&overDriveId="+overDriveId+"&formatId="+formatId+"&overdriveEmail="+overdriveEmail+"&promptForOverdriveEmail="+promptForOverdriveEmail;$.ajax({url:url,cache:false,success:function(data){if(data.availableForCheckout){checkoutOverDriveItem(overdriveId,formatId);}else{alert(data.message);hideLightbox();}},dataType:'json',async:false,error:function(){alert("An error occurred processing your request in OverDrive.  Please try again in a few minutes.");hideLightbox();}});}
function getOverDriveHoldPrompts(overDriveId,formatId,nextAction){var url=path+"/EcontentRecord/AJAX?method=GetOverDriveHoldPrompts&overDriveId="+overDriveId;if(formatId!=undefined){url+="&formatId="+formatId;}
var result=true;$.ajax({url:url,cache:false,success:function(data){result=data;if(data.promptNeeded){showHtmlInLightbox(data.promptTitle,data.prompts);}},dataType:'json',async:false,error:function(){alert("An error occurred processing your request in OverDrive.  Please try again in a few minutes.");hideLightbox();}});return result;}
function cancelOverDriveHold(overDriveId,formatId){if(loggedIn){showProcessingIndicator("Cancelling your hold in OverDrive.  This may take a minute.");var ajaxUrl=path+"/EcontentRecord/AJAX?method=CancelOverDriveHold&overDriveId="+overDriveId+"&formatId="+formatId;$.ajax({url:ajaxUrl,cache:false,success:function(data){alert(data.message);if(data.result){window.location.href=window.location.href;}else{hideLightbox();}},dataType:'json',async:false,error:function(){alert("An error occurred processing your request in OverDrive.  Please try again in a few minutes.");hideLightbox();}});}else{ajaxLogin(function(){cancelOverDriveHold(overDriveId,formatId);});}}
function returnOverDriveTitle(overDriveId,transactionId){if(confirm('Are you sure you want to return this title?')){showProcessingIndicator("Returning your title in OverDrive.  This may take a minute.");var ajaxUrl=path+"/EcontentRecord/AJAX?method=ReturnOverDriveItem&overDriveId="+overDriveId+"&transactionId="+transactionId;$.ajax({url:ajaxUrl,cache:false,success:function(data){alert(data.message);if(data.result){window.location.href=window.location.href;}else{hideLightbox();}},dataType:'json',async:false,error:function(){alert("An error occurred processing your request in OverDrive.  Please try again in a few minutes.");hideLightbox();}});}
return false;}
function selectOverDriveDownloadFormat(overDriveId){var selectedFormatId=$("#downloadFormat_"+overDriveId+" option:selected").val();var selectedFormatText=$("#downloadFormat_"+overDriveId+" option:selected").text();if(selectedFormatId==-1){alert("Please select a format to download.");}else{if(confirm("Are you sure you want to download the "+selectedFormatText+" format? You cannot change format after downloading.")){var ajaxUrl=path+"/EcontentRecord/AJAX?method=SelectOverDriveDownloadFormat&overDriveId="+overDriveId+"&formatId="+selectedFormatId;$.ajax({url:ajaxUrl,cache:false,success:function(data){if(data.result){window.location.href=data.downloadUrl;}else{alert(data.message);hideLightbox();}},dataType:'json',async:false,error:function(){alert("An error occurred processing your request in OverDrive.  Please try again in a few minutes.");hideLightbox();}});}}
return false;}
/* js/readingHistory.js */
function deletedMarkedAction(){if(confirm('The marked items will be irreversibly deleted.  Proceed?')){$('#readingHistoryAction').val('deleteMarked');$('#readingListForm').submit();}
return false;};function deleteAllAction(){if(confirm('Your entire reading history will be irreversibly deleted.  Proceed?')){$('#readingHistoryAction').val('deleteAll');$('#readingListForm').submit();}
return false;};function optOutAction(showError){if(showError){alert('Your reading history must be deleted before you can Opt Out.');return false;}
$('#readingHistoryAction').val('optOut');$('#readingListForm').submit();return false;};function optInAction(){$('#readingHistoryAction').val('optIn');$('#readingListForm').submit();return false;};function exportListAction(){$('#readingHistoryAction').val('exportToExcel');$('#readingListForm').submit();return false;};
